function Search(params) {
    console.log(params.results)

    return <div>
        {params.results.map((user) => {
            return (
                <div className="user">
                    <div className="userinfo">
                        <h1 className="username">{user.username}</h1>
                        <p className="name">{user.name}</p>
                    </div>
                    <div className="homes">
                        {user.homes.map((home) => {
                            <p>{home.name}</p>
                        })}
                    </div>
                </div>
            )
        })}
    </div>;
}

export default Search;
